import React, { Component } from "react";
import Header from "../Header";
import { Link } from "react-router-dom";

export default class UploadPage extends Component {
  render() {
    return (
      <div className="upload-page__">
        <Header />
        <h1 className="upload-page__">Upload Video</h1>
        <div className="upload-page__">
          <p className="upload-page__">VIDEO THUMBNAIL</p>
          <img className="upload-page__" src="" alt="" />
        </div>
        <div className="upload-page__">
          <p className="upload-page__">TITLE YOUR VIDEO</p>
          <input className="upload-page__" type="text" name="" id="" />
          <p className="upload-page__">ADD A VIDEO DESCRIPTION</p>
          <textarea className="upload-page__"></textarea>
        </div>
        <div className="upload-page__">
          <input className="upload-page__" type="submit" value="PUBLISH" />
          <Link exact to="/">
            <a className="upload-page__" href="">
              CANCEL
            </a>
          </Link>
        </div>
      </div>
    );
  }
}
